import React, { useState } from 'react';
import { useForm } from "react-hook-form";
import { Link } from 'react-router-dom';
import '../App.css';

const TestForm = () => {
    const onSubmit = (data) => {
        axios.post('http://localhost:3001/media', data)
            .then(res => {
                alert("Data sent successfully");
            })
            .catch(err => {
                alert("Error sending data");
            });
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
    };

    return (
        <div>
            <header className="header">
                <div className="logo">
                    <span className="logo-text">x64</span>
                </div>
                <nav className="nav">
                    <div className="search">
                        <input type="text" placeholder="–ü–æ–∏—Å–∫" />
                    </div>
                </nav>
                <div className="user-actions">
                    <Link className="icon-button" to="/Profile">üë§</Link>
                    <Link className="icon-button" to="/Statistics">üìä</Link>
                    <Link className="icon-button" to="/Favorites">‚ù§Ô∏è</Link>
                    <Link className="icon-button" to="/Cart">üõí</Link>
                </div>
            </header>

            <main>
                <h2>–§–æ—Ä–º–∞ –¥–æ–±–∞–≤–ª–µ–Ω–∏—è –º–µ–¥–∏–∞</h2>
                <form onSubmit={handleSubmit(onSubmit)}>
                    <div>
                        <label htmlFor="name">–ù–∞–∑–≤–∞–Ω–∏–µ:</label>
                        <input
                            type="text"
                            id="name"
                            name="name"
                            value={inputData.name}
                            onChange={handleInputChange}
                        />
                    </div>
                    <div>
                        <label htmlFor="description">–û–ø–∏—Å–∞–Ω–∏–µ:</label>
                        <input
                            type="text"
                            id="description"
                            name="description"
                            value={inputData.description}
                            onChange={handleInputChange}
                        />
                    </div>
                    <div>
                        <label htmlFor="url">URL:</label>
                        <input
                            type="text"
                            id="url"
                            name="url"
                            value={inputData.url}
                            onChange={handleInputChange}
                        />
                    </div>
                    <button type="submit">–û—Ç–ø—Ä–∞–≤–∏—Ç—å</button>
                </form>
            </main>
        </div>
    );
};

export default TestForm;
